import React,{Component} from 'react';

import {BrowserRouter, Route, Switch } from 'react-router-dom';
import {  } from "module";
import App from './App'
import Page2 from './Pages/Page2'
export default () =>{
    return (
        <BrowserRouter>
        <Switch>
          <Route path="/home" Component={App}></Route>  
          <Route path ="/dashboard" Component={Page2}></Route>   
        </Switch>
        </BrowserRouter>
    );
    }
